import Layout from './components/GeneralLayout';
import Navigation from './components/Navigation';
import Package from './components/Package';


import data from '../data/infoPackage.json';

function multPrint ()
{
    var cards = ["card1", "card2", "Card 3", "Card 4", "Card 5"];
    return cards.map(card => (
        <Package key={card} title={card} msg="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque eu rhoncus libero. Integer nibh ante, semper non lacus id, bibendum laoreet enim. Nulla libero ante, vestibulum non erat in, facilisis volutpat ligula." />
    ));
}

const catalogo = props => {
    return (
        <div>
            <Navigation />
            <Layout>
                <div className="row justify-content-center">
                    <h1 className="mt-2 mb-4">
                        Cat√°logo
                    </h1>
                </div>
                {multPrint()}
            </Layout>
        </div>
    )
}

catalogo.getInitialProps = async function(context) {
    const { infoPkg } = context.query;
  //
  // return { infoPkg };

    var errorCode = false;

    for (var i = 0; i < data.length; i++) {
        if (typeof data[i].id !== 'undefined' && data[i].id == infoPkg)
        {
            var result = data[i];
            // console.log(result)
            return { errorCode, info: result };
        }
    }

    errorCode = 204;
    return { errorCode, info: {} }
};

export default catalogo;
